import React, { Component, useState } from 'react'


export default class Create extends Component {
  render() {

    function handleChange(event){
      console.log(event.target);
    }

    function handleClick(event){
      console.log(event.target);
    }

    return (
      <div className='container'>
        <h4>Add visited destination</h4>
        <form>
            <div className='form-group'>
              <input onChange={handleChange} name="name" autoComplete="off" className="form-control mb-2" placeholder="Enter destinaton name"></input>
            </div>
            <div className="form-group">
              <input onChange={handleChange} name="country" autoComplete="off" className="form-control mb-2" placeholder="Enter country name"></input>
            </div>
            <div>
              <button onClick={handleClick} className="btn btn-primary">Add visited destination</button>
            </div>
        </form>
        <br />

        <h4>Add desired desination</h4>
        <form>
            <div className="form-group">
              <input autoComplete="off" className="form-control mb-2"></input>
            </div>
            <div className="form-group">
              <input autoComplete="off" className="form-control mb-2"></input>
            </div>
            <div>
              <button className="btn btn-primary">Add desired destination</button>
            </div>
        </form>

      </div>
    )
  }
}
